import "./App.css";
import React, { Component } from "react";

import axios from "axios";

class GamesList extends Component {
  constructor() {
    super();
    this.state = {
      socapi: [],
      isLoaded: true
    };
  }

  componentDidMount() {
    axios.get(`http://127.0.0.1:8000/socapi`).then(response => {
      this.setState({
        isLoaded: true,
        socapi: response.data
      });
    });
  }

  render() {
    const { socapi, isLoaded } = this.state;
    var socInfo = socapi.map(soc => (
      <ul>
        <li>{soc.id}</li>
      </ul>
    ));
    if (!isLoaded) {
      return (
        <ul>
          {socapi.map(soc => (
            <li>{soc.id}</li>
          ))}
        </ul>
      );
    }
  }
}
export default GamesList;
